from fractions import Fraction
def has_k_alignments(k, target=5):
    seen, dup = set(), set()
    for m in range(1, k + 1):
        r = k % m
        f = Fraction(r, m)
        if f >= Fraction(1, 2):
            f -= Fraction(1, 2)
        if f in seen:
            dup.add(f)
        else:
            seen.add(f)
    return len(dup) == target
